import React from 'react';

class Log extends React.Component {
    render() {
        return (
            <div className="log">
                <table className="logContents">
                    <tr>
                        <td width="5%">{props.timeStamp}</td>
                        <td width="5%">
                            <button onClick={handleClick}>stack</button>
                        </td>
                        <td width="90%">{props.log}</td>
                    </tr>
                </table>
            </div>
        );
    }
}

